{"address":"0x51dB76E1a34dB3216d39077B5fAd69f02FEB6982","signedPayload":"{
	"for": "nouns-agora",
	"delegateStatement": "I have made it my goal in the Nouns community to be a person who helps ideas take shape and find practical use in the community. I have logged countless hours on Discourse, discord, and in private chats helping people hone proposals and poke holes in ideas to find weak points or other perspectives that haven't been considered before. I enjoy doing it and I would love to be able to take ideas one step further to on-chain voting through delegation. \n\nIn these early days, I favor ideas that are new and scalable, help to onboard new community members, or provide a visible public good. I'm very critical of proposals that have been done before and have not been found to be self-sustaining. Those ideas specifically need to have a clear systemic value for existing or a proper plan to achieve sustainability in some way in the future. \n\nI'm always willing to DM if you have any questions or would like feedback on an idea or proposal. Please feel free to reach out anytime. ",
