	"delegateStatement": "**About Me:** \nI love Nouns and have been active in the ecosystem for 10+ months. Community Manager for NounPunks extension project from Nov-June, managing/hosting Twitter Spaces and some socials for Prop House since February, helping to found Nouncil and very involved in day-to-day runnings until present. Co-founded The Noun Square (Prop 101, Prop 128), doing daily nounish Twitter spaces, contests and media creation/proliferation across all social platforms. Have been a nouns delegate since June and always try to thoughtfully vote on proposals with reasons.\n\n**Voting Philosophies**\nI love to see authentic builders funded by the DAO to build. Reputation is the most important thing in this space, so I really like when on-chain proposers have already done MVPs through NSFW or Prop House to prove market fit and competency before going on chain. Quality of proposal matters a lot to me, as a proxy for commitment. Visuals, especially video are appreciated. I think public goods are very nounish and love proposals that help empower people or communities, like Prop House (free infrastructure for nouns and other DAOs) or Glasses for Kids (glasses... for kids.) I don't like Proposals that feel like \"my business, plus nouns\", or generally like the noggles have been slapped on an idea without much thought. Dollar value ROI is interesting to explore, but I believe attention is still the most valuable metric by which to judge a Prop. I think IRL activations and social media development / branding are huge opportunities for nouns, which is a nascent brand in need of broader reach. ",
