	"delegateStatement": "## Juan M. Hernandez\n\n> **Nouns is a space where you can be bold and take risks ‚Äî and be rewarded and recognized for doing so.**\n\nGM! I'm Juan, a Nouns builder ü§ñ. My goal in the DAO is to use my technical + business background to help proliferate Nouns, by directly building and also supporting others who build across the ecosystem.\n\nClassically trained in the art of software development and business strategy, I'm a tech entrepreneur with over 20 years of experience building cool fun stuff. I've been buidling in blockchain since 2016, and have launched several successful ventures, including the first regulated security token exchange in the United States. More recently I've dived into NFTs and Metaverse plays, which led to me getting \"noun pilled\" last year.\n\nNouns is at a breakout point and has an opportunity to attract the best builders in the space to continue to grow the culture, treasury and reach of the DAO. In order to do this though, we need to be be \"bold\" in how we use our treasury.\n\nTo quote someone smarter than me:\n\n> We should fund and cultivate a community of builders by experimenting, taking risks, and ultimately funding every high quality proposal that could lead to interesting culture and software (especially ‚Äòmiddleware‚Äô) on the Nouns protocol - [4156 - The Nouns Virtuous Cycle](https://medium.com/@punk4156/the-nouns-virtuous-cycle-95586bb9c7c9)\n\nAs stated before, my goal in the DAO is to use my background and skills to help proliferate Nouns. I believe we can best do this by doubling down on our efforts to draw in more builders to the community and show that Nouns is a space where you can be bold and take risks ‚Äî and be rewarded and recognized for doing so.\n\nWe have all of the raw ingredients of the Nouns protocol, now we just need to turn them into products that the whole world wants to consume, i.e., \"noun pill\" the world.\n\n## Nounish Resume:\n\n* **Composable Nouns**\n    * On-chain framework that allows for the Nouns community to expand their digital identity in new and creative ways\n    * [Read more here](https://hackmd.io/@jhernanx/B1AoPVcR5)\n* **YOLO Nouns**\n    * Going beyond FOMO, mint a Noun on each block\n    * Pushing the Nouns meme and culture\n* **Nouns Auction Tracker**\n    * DEX for multiple Nounish auctions\n    * Supporting Noun extensions and subDAOs\n    * NSFW small grants recipient\n* **NounsTown**\n    * Nouns fork with custom traits and features\n    * Precursor to YOLO and Composable Nouns\n* **Nouncil Member** \n    *  Active voter and participant in Nouncil\n* **Nounish Labs**\n    * Collective of Nounish builders\n    * Launching new ideas and initiatives across Nouns and the broader CCO ecosystem",
