{"address":"0xC3FdAdbAe46798CD8762185A09C5b672A7aA36Bb","signedPayload":"{
	"for": "nouns-agora",
	"delegateStatement": "I'm the co-founder of Vector DAO, a group of 80+ prolific contributors to crypto projects. On Nouns in particular, we built Prop 87, helped design the Nouns Vision site, co-created Pronouns, and are now building Agora. Previously, I was a designer and early employee for four years at Coinbase. Below are a summary of my main views, though I'm also generally open to supporting initiatives outside of them under the right circumstances. \n\n**Fund extremely ambitious proposals**\nToday, Nouns is highly regarded within a small community, but not yet known in the wider world. In order for the project to achieve its true potential and rival something like a Disney, Nouns DAO needs to grow by several orders of magnitude.\n\nTo do so, we need to increase our risk and size when it comes to funding ‚Äì finding and investing in more initiatives like Prop House, which have the potential to be bigger than Nouns itself. Tactically, this means routing more funding through prop house for smaller initiatives to widen the funnel of builders, and using onchain gov to selectively but ambitiously fund builders with a track record.\n\n**Invest in governance efficacy**\nIn order to up risk and size, we need to get a lot better at decision making. At a certain scale, we start competing against the best allocators at VCs and companies. How do we attract, identify and retain the best builders? I believe this must be done via deep investments in our capacity to make decisions quickly and well via a combination of funding contributors and constantly improving our tooling.\n\n**Impact = sustainability**\nWe're not going to become meaningfully more sustainable by saving a few ETH here and there. The only ways to make this grand experiment work for the long run are to either increase the daily auction take or to fund ambitious products that pay a dividend. ",
